import React from 'react';
import logo  from './img/Logo.svg';


function Navbar() {
  return (
    <div className="home">
     <nav>
        <img src={logo} alt="Logo" className="logo" />
         <ul>
            <li><a href="#about">About</a></li>
            <li><a href="#services">Services</a></li>
            <li><a href="#contact">Contact</a></li>
         </ul>
 
     </nav>
    </div>
  );
}

export default Navbar;
